import React from 'react';
import styled from 'styled-components';

const Footer = styled.footer`
background-color: #eee;
display: flex;
position: relative;
justify-content: space-between;
align-items: center;
widht: 100%;
height: 70px;
`

export default function footer() {
  return(
      <Footer></Footer>
  );
}
